class Header extends Component {


    render() {
        return (

            <div className='container'>
            <h1 className= 'logo'>MY SUPPLY DAPP</h1>
            <div className='flex-container'>
                <div className = 'sm-font'> YOUR ACCOUNT: </div>
                <div className = 'italic centered'>  {this.props.accounts } </div> 
                <div className = 'sm-font'> BALANCE:</div>
                <div className = 'italic centered'> {this.props.balance} alo </div>
            </div>
        </div>
         );

    }
}

export default Header;
